// Default
import Vue from "vue";
import Router from "vue-router";

Vue.use(Router);

// Pages
import Admin from "@/pages/Admin.vue";

import Home from "@/pages/Home.vue";
import NotFound from "@/pages/404.vue";
import Example from "@/pages/Example.vue";
import Random from "@/pages/Random.vue";
import Players from "@/pages/Players.vue";
import Photos from "@/pages/Photos.vue";

// Routering
export default new Router({
  mode: "history", // hesh /#/
  routes: [
    {
      path: "/admin",
      name: "admin",
      component: Admin,
    },
    {
      path: "/",
      name: "home",
      component: Home,
    },
    {
      path: "/example",
      name: "example",
      component: Example,
    },
    {
      path: "/random",
      name: "random",
      component: Random,
    },
    {
      path: "/players",
      name: "players",
      component: Players,
    },
    {
      path: "/photos",
      name: "photos",
      component: Photos,
    },
    {
      path: "*",
      name: "notFound",
      component: NotFound,
    },
  ],
});
